export const currentAuctionQuery = `
  fragment current_auctions on Sale {
    cover_image {
      cropped(width: 260, height: 110) {
        url
      }
    }
    end_at
    href
    id
    is_live_open
    is_preview
    live_start_at
    name
    start_at
  }
`
